import React from 'react';
import Button from './button'

function Child(props){
    var title = "Mahesh kumar"
    return (
        <div>
            <h1>{props.childName}</h1>
            <h2>{props.fullName(title)}</h2>
            <Button type="button"/>
        </div>
    )
}

export default Child;
